import React from "react";

import { BrowserRouter, Link, Switch, Route } from "react-router-dom";
function News() {
  return (
    <div className="h-[100vh] bg-[#222]">
      <BrowserRouter>
        <nav className="w-full  text-white h-[70px] bg-[#252525] flex flex-row justify-between items-center px-5">
          <h1>News</h1>
          <input
            className="w-[700px] h-[90%] bg-[#2b2a2a] px-10 rounded-lg"
            placeholder="Search for news"
          />
          <h1>hi user</h1>
        </nav>

        <Switch>
          <Route exact path="/netflix">
            Netflix
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default News;
